-- Задание №2 (Написать скрипт, возвращающий список имен (только firstname) пользователей без повторений в алфавитном порядке.)
-- только firstname

SELECT firstname
FROM users
ORDER BY firstname ASC;

-- только lastname
SELECT lastname
FROM users
ORDER BY lastname ASC;

-- только lastname в обратном порядке

SELECT lastname
FROM users
ORDER BY lastname DESC;

-- Задание №3 (Первые пять пользователей пометить как удаленные.)

UPDATE users
SET 
	is_deleted = 1
WHERE id = 1;

UPDATE users
SET 
	is_deleted = 1
WHERE id = 2;

UPDATE users
SET 
	is_deleted = 1
WHERE id = 3;

UPDATE users
SET 
	is_deleted = 1
WHERE id = 4;

UPDATE users
SET 
	is_deleted = 1
WHERE id = 5;

-- Задание №4 Написать скрипт, удаляющий сообщения «из будущего» (дата больше сегодняшней).
-- Так как сгенерированные даты, все позже, сначала с помощью UPDATE я исправлю некоторые даты на "будущие"

UPDATE messages 
SET 
	created_at = '2024-02-21 12:40:58'
WHERE id = 1;

UPDATE messages 
SET 
	created_at = '2025-05-21 02:55:54'
WHERE id = 2;

UPDATE messages 
SET 
	created_at = '2023-10-31 11:30:45'
WHERE id = 3;

DELETE FROM messages 
WHERE created_at > now();
